.swiper {
  width: 100%;
  height: 100%;
  &-slide {
    text-align: center;
    font-size: 18px;
    background: #fff;

    display: -webkit-box;
    display: -ms-flexbox;
    display: -webkit-flex;
    display: block;
    -webkit-box-pack: center;
    -ms-flex-pack: center;
    -webkit-justify-content: center;
    justify-content: center;
    -webkit-box-align: center;
    -ms-flex-align: center;
    -webkit-align-items: center;
    align-items: center;
    width: 100%;
    height: 100%;
    object-fit: cover;
  }
}

.swiper-pagination {
  margin-bottom: 86px;
  @media screen and (min-width: 768px) {
    margin-bottom: 119px;
  }
  @media screen and (min-width: 1280px) {
    margin-bottom: 132px;
  }
  &-bullet {
    width: 12px;
    height: 12px;
    &:not(:last-child) {
      margin-right: 14px !important;
    }
    &-active::before {
      content: '';
      display: block;
      background-image: url('/images/for-all/home.svg');
      background-size: 12px 12px;
      width: 12px;
      height: 12px;
      background-color: #fff;
    }
  }
}

